import React, { Component } from 'react';
import {Collapse, Navbar, NavbarBrand, Nav, NavItem, NavLink, Button} from 'reactstrap';
import './App.css';

export default class App extends Component {
  render() {
    return (
      <div className="App">
          <Navbar></Navbar>
        <header className="HackCU">
          <h1>HACKCU 2019</h1>
        </header>
      </div>
    );
  }
}
